

class SlowSolution(object):
	def threeSum(self, nums):
		"""
		:type nums: List[int]
		:rtype: List[List[int]]
		"""
		res = set()
		N = len(nums)
		for i in xrange(N-2):
			for j in xrange(i+1, N-1):
				for k in xrange(j+1, N):
					if nums[i] + nums[j] + nums[k] == 0:
						res.add( tuple(sorted([nums[i], nums[j], nums[k]])) )
		return list(res)

class Solution(object):
	def threeSum(self, nums):
		"""
		:type nums: List[int]
		:rtype: List[List[int]]
		"""
		# print "L", len(nums)
		nums.sort()
		# print nums

		# print 1
		numset = set(nums)
		twosum = {}
		# counter = 0

		for i in xrange(len(nums)-1, -1, -1):
			for j in xrange(i+1, len(nums)):
				s = nums[i] + nums[j]
				if -s not in numset: continue

				try: twosum[s].append( (i, j))
				except: twosum[s] = [(i, j)]
				# counter += 1
				if nums[i] == nums[j]: break

		# print 2
		# print twosum
		res = set()
		for i, n in enumerate(nums):
			if i > 1 and nums[i-1] == n: continue

			for j, k in twosum.get(-n, ()):
				if i < j:
					res.add( (nums[i], nums[j], nums[k] ) )

		# print 3
		return list(res)


